import React from 'react';
import '../scss/mainPage.scss';

function MainPage() {
  return (
    <div className="pageWrap">
      <div className="backgroundGroup">
        <div className="one"></div>
        <div className="two"></div>
        <div className="three"></div>
      </div>
    </div>
  );
}

export default MainPage;
